/* lit un sudoku sur l'entrée standard */
std::vector<int > read_sudoku(){
  int a = 9 * 9;
  std::vector<int > out_( a );
  for (int i = 0 ; i < a; i++)
  {
    int k = 0;
    scanf("%d", &k);
    scanf("%*[ \t\r\n]c", 0);
    out_.at(i) = k;
  }
  return out_;
}

/* affiche un sudoku */
void print_sudoku(std::vector<int >& sudoku_){
  for (int y = 0 ; y <= 8; y ++)
  {
    for (int x = 0 ; x <= 8; x ++)
    {
      int b = sudoku_.at(x + y * 9);
      std::cout << b;
      std::cout << " ";
      if ((x % 3) == 2)
        std::cout << " ";
    }
    std::cout << "\n";
    if ((y % 3) == 2)
      std::cout << "\n";
  }
  std::cout << "\n";
}

